import classes from './'

const Button = () => {
  const handleStart = () => {};

  const handlePaused = () => {};

  const handleReset = () => {};

  return (
    <div>
      <button className={classes['stowatch-btn stopwatch-btn-gre']} onClick={handleStart}>Start</button>
      <button onClick={handlePaused}>Stop</button>
      <button onClick={handleReset}>Reset</button>
    </div>
  );
};

export default Button;
